import React, { useEffect, useState } from "react";
import {
  ShowFilterType,
  SortByType,
  SortType,
  useStoreProfile,
} from "../../store-shipping";

import moment from "moment";
import { useNavigate } from "react-router-dom";
import { useStoreAddress } from "../../store-address";

const TableAddress = () => {
  const navigate = useNavigate();
  const { setFetchAddress, addressDatas, filterAddress, dataFilter, loading } =
    useStoreAddress();
  const [input, setInput] = useState({
    show: "LAST_10_TRX",
    sortBy: "DATE",
    sort: "DESC",
    search: "",
  });
  console.log(dataFilter, "======================");
  console.log(addressDatas, "1111111111111111");

  const dateFormat = (date: string): string => {
    return moment(date).format("HH:mm - DD MMMM YYYY");
  };

  const handleChangeInput = (event: React.FormEvent<HTMLInputElement>) => {
    setInput({
      ...input,
      [event.currentTarget.name]: event.currentTarget.value,
    });
  };

  console.log(input, "e2e2e2e2");

  const handleFilter = () => {
    filterShipping(
      input.show as ShowFilterType,
      input.sortBy as SortByType,
      input.sort as SortType,
      input.search
    );
  };
  const handleChangeSelect = (event: React.FormEvent<HTMLSelectElement>) => {
    setInput({
      ...input,
      [event.currentTarget.name]: event.currentTarget.value,
    });
  };

  useEffect(() => {
    setFetchShipping();
  }, []);

  useEffect(() => {
    handleFilter();
  }, [input.show, input.sortBy, input.sort, input.search]);

  const renderTable = () => {
    return (
      <>
        <div className="d-flex flex-warp my-4">
          <div className="d-flex flex-fill align-items-center">
            <label className="m-0 me-2" />
            <p>Show</p>
            <select
              onChange={handleChangeSelect}
              defaultValue="THIS_MONTH"
              name="show"
              id="show"
              className="form-select"
            >
              <option value="LAST_10_TRX">Last 10 transactions</option>
              <option value="THIS_MONTH">This month</option>
              <option value="LAST_MONTH">Last month</option>
              <option value="THIS_YEAR">This year</option>
              <option value="LAST_YEAR">Last year</option>
            </select>
          </div>
          <div className="mx-1 my-2 d-flex align-items-center">
            <label htmlFor="sortBy" className="m-0 me-2">
              Sort By
            </label>
            <select
              name="sortBy"
              id="sortBy"
              className="form-select"
              onChange={handleChangeSelect}
            >
              <option value="DATE">Date</option>
              <option value="AMOUNT">Amount</option>
            </select>
          </div>
          <div className="mx-1 my-2">
            <select
              name="sort"
              id="sort"
              className="form-select"
              onChange={handleChangeSelect}
            >
              <option value="DESC">Descending</option>
              <option value="ASC">Ascending</option>
            </select>
          </div>
          <div className="mx-1 my-2">
            <input
              type="text"
              name="search"
              placeholder="Search..."
              onChange={handleChangeInput}
              className="form-control"
            />
          </div>
        </div>
        <div className="table-responsive">
          <table className="table table-striped table-bordered tabel-hover">
            <thead className="table-head">
              <tr>
                <th scope="col">Date & Time</th>
                <th scope="col">Full Address</th>
                <th scope="col">Recipient Name</th>
                <th scope="col">Recipient Phone Number</th>
                <th scope="col"></th>
              </tr>
            </thead>
            <tbody className="table-body">
              {dataFilter.map((shippingState) => (
                <tr key={shippingState.id}>
                  <td>{shippingState.CreatedAt}</td>
                  <td>{shippingState.size.name}</td>
                  <td>{shippingState.address.full_address}</td>
                  <td>{shippingState.address.recipient_name}</td>
                  <td>
                    <button
                      onClick={() => {
                        navigate(`/shipping/${shippingState.id}`, {
                          replace: true,
                        });
                      }}
                      className="btn btn-success"
                    >
                      Detail
                    </button>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </>
    );
  };

  return (
    <>
      <div className="container">{loading ? "loading" : renderTable()}</div>
    </>
  );
};

export default TableAddress;
